import {Container} from 'react-bootstrap';
import Listing from './listing.js';

function Education(){
    return (
        <div>
            <Container>
                <h2 className="Tagline">Education</h2>
                <hr />
            </Container>
            <Listing title="Bachelor of Medincine" location="Unversity of the Capital"
                startYear="1917" endYear="1920"/>
            <Listing title="Master of Thanatology" location="University of the Capitol"
                startYear="1920" endYear="1922"
                description="Thesis title: \'A Meta-Analysis Of The Existing Methodology Employed to Slow or Stop Our Countinous March Torward Death  \' " />

        </div>
    )

} export default Education;
